import React from 'react';
import CardSection from '../cardSection';
import { dataCard } from './data';

const FitureSection = () => {
  return (
    <>
      <div className="bg-white border-gray-300 px-2">
        <div className="container mx-auto sm:my-20">
          <div className="mt-10 mx-auto sm:mt-12 sm:px-6 lg:mt-20 lg:px-8 h-full">
            {dataCard.map((value) => {
              <div key={value.id}>
                <CardSection label={value.label} desc={value.desc} />
              </div>;
            })}
          </div>
        </div>
      </div>
    </>
  );
};

export default FitureSection;
